;; **
;;; ## Graphs
;;; 
;;; The fundamental data structure in @@GrapeVine@@ is that of a graph. More precisely, the tool supports _directed, attributed, node- and edge-labeled (danel)_ graphs. (cf. left side of Fig. 1)
;;; 
;;; @@GrapeVine@@ uses a database to store graphs. Graphs, once defined are persisted. Arbitrarily many graphs can be created. Morevover, graphs are maintained in a [fully persistent data structures](https://en.wikipedia.org/wiki/Persistent_data_structure), i.e., _all_ versions of a graph can be accessed and modified. (This is indicated in the right-side of the meta-model in Fig. 1, which shows that the internal data structure stores a version history of graphs.)
;;; 
;;; A new (empty) graph is created using the `(newgrape)` function:
;; **

;; @@
(newgrape)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-list'>(</span>","close":"<span class='clj-list'>)</span>","separator":" ","items":[{"type":"html","content":"<span class='clj-string'>&quot;67ab0944-e930-47d4-a91c-b385c6eb68c2&quot;</span>","value":"\"67ab0944-e930-47d4-a91c-b385c6eb68c2\""}],"value":"(\"67ab0944-e930-47d4-a91c-b385c6eb68c2\")"}
;; <=

;; **
;;; As shown above, graphs are identified with a unique ID. To use them in programs, we can always define a _var_ to refer to a graph. The statement below defines a _var_ that refers to an empty graph.
;;; 
;;; > _Note: if you are not familiar with Clojure, you can think of vars are similar to variables in other languages._
;; **

;; @@
(def g0 (newgrape))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;tutorial/g0</span>","value":"#'tutorial/g0"}
;; <=

;; **
;;; The computational notebook has a form **`view`** to generate an image of the content of a graph. (These images are saved when the worksheet is saved.)
;; **

;; @@
(view g0)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"429\" height=\"132\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x35350c5e \"BufferedImage@35350c5e: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@2f1bbd78 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 429 height = 132 #numDataElements 3 dataOff[0] = 2\"]"}],"value":"(#gorilla_repl.image.ImageView{:image #object[java.awt.image.BufferedImage 0x35350c5e \"BufferedImage@35350c5e: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@2f1bbd78 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 429 height = 132 #numDataElements 3 dataOff[0] = 2\"], :alt \"\", :type \"png\", :width 429, :height 132})"}
