;; **
;;; ### Application Conditions
;;; 
;;; Rules may be required to meet certain conditions to be applicable. These so-called _application conditions_ include conditions that are global to a rule's matching semantics and conditions that pertain to individual graph elements (local application conditions). 
;;; 
;;; #### Global application conditions
;;; 
;;; ##### Injectivity condition
;;; Rules may be defined to require **_injective_** matching semantics. By default, different graph elements in the rule are allowed to match to the _same_ graph element in the graph that the rule is applied to. To understand this better, consider a graph (`g1`) with one `Hello` node:
;; **

;; @@
(def g1 (-> (newgrape) hello))
(view g1)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"423\" height=\"133\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x45b41f23 \"BufferedImage@45b41f23: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@377d1d8e transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 423 height = 133 #numDataElements 4 dataOff[0] = 3\"]"}],"value":"(#gorilla_repl.image.ImageView{:image #object[java.awt.image.BufferedImage 0x45b41f23 \"BufferedImage@45b41f23: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@377d1d8e transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 423 height = 133 #numDataElements 4 dataOff[0] = 3\"], :alt \"\", :type \"png\", :width 423, :height 133})"}
;; <=

;; **
;;; Now consider the following rule. It creates a  relationship `rel` between "two" `Hello` nodes. 
;; **

;; @@
(rule rel []
   (read 
      (node h:Hello)
      (node h2:Hello))
   (create 
  	  (edge e:rel h h2)))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"139\" height=\"251\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x2385622b \"BufferedImage@2385622b: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@1582fd36 transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 139 height = 251 #numDataElements 4 dataOff[0] = 3\"]"}
;; <=

;; **
;;; Is this rule applicable to graph `g1`? The answer to this question depends on the matching semantics. If **_non-injective_** matches are allowed, the two `Hello` nodes in rule `rel` may in fact be matched to the _same_ node in the graph the rule is applied to. 
;;; 
;;; The match is illustrated in the following figure:
;;; 
;;; ![](https://github.com/jenshweber/grape/blob/master/help/match.png?raw=true)
;;; 
;;; 
;;; Applying this rule will result in a node with a `rel` edge to itself:
