;; **
;;; The above (non-injective) matching semantics is the default. However, matching multiple nodes in a rule to a single node in the graph may not be desirable in some appliations. In this case, the rule designer can specify the rule to enforce the **_injectivity condition_**. The following rule `rel2` is identical to the above rule `rel`, except that it requires _injective_ matches. This is visualized by a hooked arrow in the rule header.
;; **

;; @@
(rule rel2 []
   (global INJ)
   (read 
       (node h:Hello)
       (node h2:Hello))
   (create 
       (edge :rel h h2)))
