;; **
;;; As the above result shows, this is indeed possible.
;;; 
;;; ##### Identification condition
;;; 
;;; The identification condition (IDC) requires that graph elements to be deleted must be uniquely identified by elements in the rule's left-hand side. As an example, consider the following rule `delhello`, which matches two `Hello` nodes and deletes one of them.
;; **

;; @@
(rule delhello []
   (read 
      (node h:Hello)
      (node h2:Hello))
   (delete h))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"240\" height=\"133\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0xd2f2570 \"BufferedImage@d2f2570: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@377d1d8e transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 240 height = 133 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; **
;;; Consider applying rule `delhello` to the following graph, which contains a single `hello` node. The rule can find a match by mapping the _two_ nodes (`h` and `h2`) in the rule to the same node in the graph. However, there is a conflict: The rule states that `h` should be deleted while `h2` should be preserved. What should be done if both nodes are matched to the same node in the input graph?
;;; 
;;; We could either disallow such applications (which by requiring the _identification condition_), or we can resolve the conflict in favour of deletion or in faviour of preservation.
;; **

;; @@
(def g2 (-> (newgrape) hello))
(view g2)
