;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"429\" height=\"133\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x6a80421c \"BufferedImage@6a80421c: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@377d1d8e transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 429 height = 133 #numDataElements 3 dataOff[0] = 2\"]"}],"value":"(#gorilla_repl.image.ImageView{:image #object[java.awt.image.BufferedImage 0x6a80421c \"BufferedImage@6a80421c: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@377d1d8e transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 429 height = 133 #numDataElements 3 dataOff[0] = 2\"], :alt \"\", :type \"png\", :width 429, :height 133})"}
;; <=

;; **
;;; By default, @@GrapeVine@@ rules do not enforce the _identification condition_ and any conflicts are resolved in favour of deletion. This is demonstrated below. The application of `delhello` to `g2` is indeed possible and deletes the matched node:
;; **

;; @@
(delhello g2)
(view _)
;; @@
