;; **
;;; The identification condition can be enforced by adding **`ID`** to the global application conditions of a rule. Below is a version of the above rule that enforces this condition. The identification condition is visualized with an crossed arrow.
;; **

;; @@
(rule delhello-safe []
   (global ID)
   (read 
      (node h:Hello)
      (node h2:Hello))
   (delete h))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"343\" height=\"133\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x30e6b450 \"BufferedImage@30e6b450: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@78ee9560 transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 343 height = 133 #numDataElements 4 dataOff[0] = 3\"]"}
