;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"428\" height=\"251\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x439a756d \"BufferedImage@439a756d: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@404c512b transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 428 height = 251 #numDataElements 4 dataOff[0] = 3\"]"}],"value":"(#gorilla_repl.image.ImageView{:image #object[java.awt.image.BufferedImage 0x439a756d \"BufferedImage@439a756d: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@404c512b transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 428 height = 251 #numDataElements 4 dataOff[0] = 3\"], :alt \"\", :type \"png\", :width 428, :height 251})"}
;; <=

;; @@
(rule delworld []
      (read (node w:World))
      (delete w))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"184\" height=\"133\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x6f93c7de \"BufferedImage@6f93c7de: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@404c512b transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 184 height = 133 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; **
;;; Clearly, rule `delworld` would find a match in graph `g`. However, deleting the matched `World` node would leave a "dangling" `to` edge. Of course, such "dangling" edges are not allowed, since the result would no longer be a valid graph. Two alternatives remain:
;;; 1. either we could also automatically delete any dangling edges, or
