;; **
;;; The dangling condition can be enforced by adding the __`DANG`__ condition to the set of global application conditions of a rule. The following rule is identical to the above `delworld` rule, except that it enforces the dangling condition.
;; **

;; @@
(rule delworld-safe []
      (global DANG)
      (read (node w:World))
      (delete w))
