;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"244\" height=\"133\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x7787ba14 \"BufferedImage@7787ba14: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@78ee9560 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 244 height = 133 #numDataElements 3 dataOff[0] = 2\"]"}
