;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"260\" height=\"251\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x43c5d108 \"BufferedImage@43c5d108: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@7c0c53ca transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 260 height = 251 #numDataElements 4 dataOff[0] = 3\"]"}
