;; **
;;; ## Alternative matches and equivalence
;;; 
;;; Consider the example of a graph `g` with two `hello` nodes again.  Is there only one possible way to apply rule `rel2`? (see below)
;; **

;; @@
(rule rel2 []
   (global INJ)
   (read 
      (node h:Hello)
      (node h2:Hello))
   (create 
  	  (edge e:rel h h2)))
 
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"229\" height=\"251\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x4540b50d \"BufferedImage@4540b50d: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@348e2d9c transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 229 height = 251 #numDataElements 4 dataOff[0] = 3\"]"}
;; <=

;; @@
(-> (newgrape) hello hello rel2 view )
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"428\" height=\"251\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x344791f5 \"BufferedImage@344791f5: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@348e2d9c transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 428 height = 251 #numDataElements 4 dataOff[0] = 3\"]"}],"value":"(#gorilla_repl.image.ImageView{:image #object[java.awt.image.BufferedImage 0x344791f5 \"BufferedImage@344791f5: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@348e2d9c transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 428 height = 251 #numDataElements 4 dataOff[0] = 3\"], :alt \"\", :type \"png\", :width 428, :height 251})"}
